const profile_icon = './../assets/images/profile_icon.svg';
const orders_icon = './../assets/images/orders_icon.svg';
const cart_icon = './../assets/images/cart_icon.svg';

export const additionalItems = [
    { content: 'Бренды', path: '/brands' },
    { content: 'Доставка', path: '/delivery' },
    { content: 'Возврат', path: '/refund' },
    { content: 'Документация', path: '/documentation' },
    { content: 'Контакты', path: '/contacts' },
];

export const navItem = [
    { img: profile_icon, text: "Профиль", path: '/profile' },
    { img: orders_icon, text: "Заказы", path: '/orders' },
    { img: cart_icon, text: "Корзина", path: '/cart' },
];

export const breadCrumbs = [
    { text: 'Акции', path: '/' },
    { text: 'Строительные материалы', path: '/' },
    { text: 'Керамическая плитка', path: '/' },
    { text: 'Краски', path: '/' },
    { text: 'Сантехника', path: '/' },
    { text: 'Напольные покрытия', path: '/' },
    { text: 'Инструменты', path: '/' },
    { text: 'Обои', path: '/' },
    { text: 'Окна', path: '/' },
];
